(21, 'testing hotel', '<div class="fix-small">\r\n<div class="fix site-tags" id="the-hotel-desc">\r\n<p>The hotel is ideally located on <strong>Paseo de Gracia</strong>, the main commercial artery of the city, in the heart of <strong>modernist Barcelona</strong> and opposite <strong>Gaud&iacute;&rsquo;s La Pedrera</strong>. A few minutes away is <strong>Plaza Catalu&ntilde;a</strong> and the <strong>historic centre</strong> of the city, as well as other places of interest that make <strong>Barcelona</strong> one of Europe&rsquo;s most attractive and cosmopolitan cities.</p>\r\n\r\n<p>The hotel occupies one former nineteenth century palace &ndash; Casa Daurella&reg; - which have been expanded and renovated to the highest architectural standards to create a modern, functional and first-class hotel in which art and unique historical elements coexist with the most modern comforts.</p>\r\n\r\n<p>The Hotel stands out for its gastronomic excellence under the management of <strong>Mart&iacute;n Berasategui</strong>, who advises on and oversees all of the Hotel&rsquo;s restaurant services.</p>\r\n</div>\r\n</div>', '1507780880easy-logo.svg', 'Hotel Heidehof is a 4-Star luxury hotel which was opened in April 1996. It has 108 quality rooms (50 double, 48 single, 4 Family and 6 Suites) and a modern, well equipped conference area which can host events of every kind for up to 100 persons. It is about 30kms S.W. of the Baltic sea coast and makes an ideal stopover on your journey.', 2, '2,4,5,7,9', 3, 1, 'Adam and Eve Resort, Via Costa Verde, Numana, Province of Ancona, Italy', '', 'tester', '(815) 398-2014', '2,3,5', '', '', '', '', 0, 0, 'tester@mailinator.com', 'tester@mailinator.com', '150', '10', 0, '2017-10-12 04:01:20', '2017-10-13 09:48:42', 0, 0, 1, 1, 0, '12:00pm', '1:00pm', 1, '', '0', '0'),
